import styles from './Button.module.css';
import { MdMessage } from "react-icons/md";
import React from 'react';

const Button = () => {
  return (
    <div>
        <button className={`${styles.primary_btn}`}>
        <MdMessage fontSize="24px" padding/>  VIA SUPPORT CHAT
        </button>
      
    </div>
  )
}

export default Button
